import { LoadingButton } from "@mui/lab";
import {
  TextField,
  Typography,
  FormControlLabel,
  Checkbox,
  Grid,
  Card,
} from "@mui/material";
import { Container, Box } from "@mui/system";
import React from "react";
import { Link } from "react-router-dom";

type CreateTaskPanelProps = {};

const CreateTaskPanel: React.FC<CreateTaskPanelProps> = () => {
  const handleSubmit = () => {};

  return (
    <Container>
      <Card
        variant="outlined"
        sx={{
          marginTop: 8,
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
       
        <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
        <Typography component="h1" variant="h5">
          Create Task Panel
        </Typography>
          <TextField
            id="taskName"
            label="Task name"
            variant="standard"
            margin="normal"
            required
            fullWidth
            name="email"
            autoComplete="email"
            autoFocus
          />
          <TextField
          multiline
            id="taskDescription"
            label="Task Description"
            variant="standard"
            margin="normal"
            required
            fullWidth
            name="email"
            autoComplete="email"
            autoFocus
            placeholder="Add a detailed description of the task"
          />          
                   
          <LoadingButton
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2 }}
            //loading={loading}
          >
            Create Task
          </LoadingButton>
        </Box>
      </Card>
    </Container>
  );
};
export default CreateTaskPanel;
